unsigned pm(unsigned a, unsigned b) {
	unsigned res = 1;
	while (b) {
		if (b & 1) res = (unsigned long long) res * a % MOD;
		a = (unsigned long long) a * a % MOD, b >>= 1;
	}
	return res;
}

unsigned f(unsigned a, unsigned b) {
	unsigned r0 = 1, r1 = 1, r2 = 1, r3 = 1, r4 = 1, r5 = 1, r6 = 1, r7 = 1, r8 = 1, r9 = 1;
	while ((unsigned long long) a + 9 <= b) {
		r0 = (unsigned long long) r0 * a++ % MOD;
		r1 = (unsigned long long) r1 * a++ % MOD;
		r2 = (unsigned long long) r2 * a++ % MOD;
		r3 = (unsigned long long) r3 * a++ % MOD;
		r4 = (unsigned long long) r4 * a++ % MOD;
		r5 = (unsigned long long) r5 * a++ % MOD;
		r6 = (unsigned long long) r6 * a++ % MOD;
		r7 = (unsigned long long) r7 * a++ % MOD;
		r8 = (unsigned long long) r8 * a++ % MOD;
		r9 = (unsigned long long) r9 * a++ % MOD;
	}
	r0 = (unsigned long long) r0 * r1 % MOD;
	r0 = (unsigned long long) r0 * r2 % MOD;
	r0 = (unsigned long long) r0 * r3 % MOD;
	r0 = (unsigned long long) r0 * r4 % MOD;
	r0 = (unsigned long long) r0 * r5 % MOD;
	r0 = (unsigned long long) r0 * r6 % MOD;
	r0 = (unsigned long long) r0 * r7 % MOD;
	r0 = (unsigned long long) r0 * r8 % MOD;
	r0 = (unsigned long long) r0 * r9 % MOD;
	while (a <= b)
		r0 = (unsigned long long) r0 * a++ % MOD;
	return r0;
}

int main() {
	int N; unsigned long long n;
	scanf("%d", &N);
	while (N--) {
		scanf("%llu", &n);
		if (n >= MOD)
			printf("0\n");
		else if (n < BLK)
			printf("%u\n", f(1, n));
		else if (n > MOD - 100000) {
			unsigned ans = MOD - 1;
			for (unsigned i = n + 1; i < MOD; i++)
				ans = (unsigned long long) ans * pm(i, MOD - 2) % MOD;
			printf("%u\n", ans);
		} else {
			unsigned idx = n / BLK;
			unsigned ans = (MAGIC[idx << 1] - 100000) << 16 | (MAGIC[idx << 1 | 1] - 100000);
			printf("%u\n", (unsigned long long) ans * f(idx * BLK, n) % MOD);
		}
	}
}